HomecharactertxtLocalData.tab={
[9000001] = {9000001,	"這裏的氣氛真讓人舒心。",	"0",	"0",	"0",	"这里的气氛真让人舒心。"},
[9000002] = {9000002,	"好久沒回家了，等下次有機會帶點這裡的特產回去吧，對了...還得多帶點零食回去，小薇她們一定會高興的！",	"0",	"0",	"0",	"好久没回家了，等下次有机会带点这里的特产回去吧，对了...还得多带点零食回去，小薇她们一定会高兴的！"},
[9000003] = {9000003,	"我喜歡料理，也喜歡大家幸福的笑容。如果有機會的話，就讓我做一頓大餐犒勞大家吧。",	"0",	"0",	"0",	"我喜欢料理，也喜欢大家幸福的笑容。如果有机会的话，就让我做一顿大餐犒劳大家吧。"},
[9000004] = {9000004,	"以前都是我摸著弟弟妹妹的頭，哄她們入睡。像這樣被領航摸著頭...有一種特別的感覺，嘻嘻。",	"0",	"0",	"0",	"以前都是我摸着弟弟妹妹的头，哄她们入睡。像这样被领航摸着头...有一种特别的感觉，嘻嘻。"},
[9000005] = {9000005,	"領航真的很喜歡摸頭呢，嘻嘻。",	"0",	"0",	"0",	"领航真的很喜欢摸头呢，嘻嘻。"},
[9000006] = {9000006,	"領航，不要捉弄我了。我知道最近胖了，我會認真執行減肥計劃的。",	"0",	"0",	"0",	"领航，不要捉弄我了。我知道最近胖了，我会认真执行减肥计划的。"},
[9000007] = {9000007,	"領航，哈哈哈...別...別摸了，好癢啦，哈哈哈哈哈哈...我要生氣了喔！",	"0",	"0",	"0",	"领航，哈哈哈...别...别摸了，好痒啦，哈哈哈哈哈哈...我要生气了哦！"},
[9000008] = {9000008,	"誒——領航！要是您覺得不管如何我都不會生氣的話，那您就大錯特錯了！別看我這樣，生氣起來可是很、很可怕的哦！",	"0",	"0",	"0",	"诶——领航！要是您觉得不管如何我都不会生气的话，那您就大错特错了！别看我这样，生气起来可是很、很可怕的哦！"},
[9000009] = {9000009,	"領航！要適可而止！",	"0",	"0",	"0",	"领航！要适可而止！"},
[9000010] = {9000010,	"領航，歡迎回來，需要喝點什麼嗎？",	"0",	"0",	"0",	"领航，欢迎回来，需要喝点什么吗？"},
[9000011] = {9000011,	"呼....我會努力的，領航！",	"0",	"0",	"0",	"呼....我会努力的，领航！"},
[9000012] = {9000012,	"我...我想盡自己所能地幫領航分憂解難，可以嗎？",	"0",	"0",	"0",	"我...我想尽自己所能地帮领航分忧解难，可以吗？"},
[9000013] = {9000013,	"弗蘭卡在艾吉斯內部穿著的服飾之一，弗蘭卡，像往常一樣在與自己家人通話。最近家那邊的天氣怎麼樣？在我走之後餐館的生意怎麼樣了，沒有我幫忙的話，家裡會不會很忙？對了小薇想要來首都念書的話可要好好努力了，明年就可以考到這裡了，我攢了不少的錢快可以在首都買房子，爸爸媽媽也可以一起來住……一點一滴，弗蘭卡仔細地把這些事情記在心裡。真好呀。",	"0",	"0",	"0",	"弗兰卡在艾吉斯内部穿着的服饰之一，弗兰卡，像往常一样在与自己家人通话。最近家那边的天气怎么样？在我走之后餐馆的生意怎么样了，没有我帮忙的话，家里会不会很忙？对了小薇想要来首都念书的话可要好好努力了，明年就可以考到这里了，我攒了不少的钱快可以在首都买房子，爸爸妈妈也可以一起来住……一点一滴，弗兰卡仔细地把这些事情记在心里。真好呀。"},
[9000014] = {9000014,	"解鎖指揮室",	"0",	"0",	"0",	"测试文本"},
[9001001] = {9001001,	"這個地方...馬馬虎虎吧。不過要是讓本小姐來裝修的話，肯定能佈置得更好！",	"0",	"0",	"0",	"这个地方...马马虎虎吧。不过要是让本小姐来装修的话，肯定能布置得更好！"},
[9001002] = {9001002,	"嗯...我決定好了！領航，就算我們的任務不能公之於眾，我也要向所有人證明特別聯合部隊是艾吉斯最優秀的駕駛員部隊！",	"0",	"0",	"0",	"嗯...我决定好了！领航，就算我们的任务不能公之于众，我也要向所有人证明特别联合部队是艾吉斯最优秀的驾驶员部队！"},
[9001003] = {9001003,	"也不知道臭老爹現在怎麽樣了......欸，我可不是在擔心他，只是怕因為他的事情而敗壞了本小姐的名聲而已。",	"0",	"0",	"0",	"也不知道臭老爹现在怎么样了...我可不是在担心他，只是怕因为他的事情而败坏了本小姐的名声而已。"},
[9001004] = {9001004,	"2、3......沒什麽，我只是在數你摸了多少次而已，待會就會全部奉還的。",	"0",	"0",	"0",	"2、3......没什么，我只是在数你摸了多少次而已，待会就会全部奉还的。"},
[9001005] = {9001005,	"心情...微妙得沒那麼糟糕。",	"0",	"0",	"0",	"心情...微妙得没那么糟糕。"},
[9001006] = {9001006,	"你這...變態！你就不能更加紳士一點，更加溫柔一點嗎！？",	"0",	"0",	"0",	"你这...变态！你就不能更加绅士一点，更加温柔一点吗！？"},
[9001007] = {9001007,	"殺了你，絕對要殺了你！本小姐從來沒有受到過這種屈辱，你給我做好心理準備吧！“我會負責的”？...你在說什麼傻話，不...不要以為這樣就可以應付我！",	"0",	"0",	"0",	"杀了你，绝对要杀了你！本小姐从来没有受到过这种屈辱，你给我做好心理准备吧！“我会负责的”？...你在说什么傻话，不...不要以为这样就可以应付我！"},
[9001008] = {9001008,	"嗚——好冷...突然間在做什麼？不要嚇我啦！",	"0",	"0",	"0",	"呜——好冷...突然间在做什么？不要吓我啦！"},
[9001009] = {9001009,	"喂！你不會對其他的女孩子也這麼做了吧...看來必須要撥亂反正了！",	"0",	"0",	"0",	"喂！你不会对其他的女孩子也这么做了吧...看来必须要拨乱反正了！"},
[9001010] = {9001010,	"領航，歡迎回……你這是什麼表情，你覺得我會因為無聊在這裡大鬧特鬧嗎？讓你失望了，本小姐不是那種無理取鬧的人。",	"0",	"0",	"0",	"领航，欢迎回……你这是什么表情，你觉得我会因为无聊在这里大闹特闹吗？让你失望了，本小姐不是那种无理取闹的人。"},
[9001011] = {9001011,	"哼哼~不管什麼樣的工作，我都會漂亮地完成的。",	"0",	"0",	"0",	"哼哼~不管什么样的工作，我都会漂亮地完成的。"},
[9001012] = {9001012,	"餵，領航，你平常都在做什麼...沒什麼，只是想稍微了解一下你而已，不行麼？",	"0",	"0",	"0",	"喂，领航，你平常都在做什么...没什么，只是想稍微了解一下你而已，不行么?"},
[9001013] = {9001013,	"查麗莎的服飾。終於不用像是換裝娃娃那樣，被每天照顧著穿上各式各樣的衣服了。查麗莎對這身衣服的滿意程度大概有10000分，只要是你能遇見不是巨大化的查麗莎，她一定穿著這身衣服，據說她定制了20套同樣的衣服。",	"0",	"0",	"0",	"查丽莎的服饰，终于不用像是换装娃娃那样，被每天照顾着穿上各式各样的衣服了，查丽莎对这身衣服的满意程度大概有10000分，只要是你能遇见不是巨大化的查丽莎，她一定穿着这身衣服，据说她定制了20套同样的衣服。"},
[9001014] = {9001014,	"新晉者活動獎勵",	"0",	"0",	"0",	"测试文本"},
[9002001] = {9002001,	"這就是領航平時待的地方嗎？（嗅嗅）有種讓人安心的味道......啊！請、請忘掉剛才的話......",	"0",	"0",	"0",	"这就是领航平时待的地方吗？（嗅嗅）有种让人安心的味道......啊！请，请忘掉刚才的话......"},
[9002002] = {9002002,	"......安潔莉卡隊長。我有好好地在努力喔......你有看到嗎。",	"0",	"0",	"0",	"......安洁莉卡队长。我有好好地在努力哦......你有看到吗。"},
[9002003] = {9002003,	"什麼？擔心我嗎......放心，領航，我還有重要的隊友們呢......不管是現在的，亦或者過去，一直沒有變。",	"0",	"0",	"0",	"什么？担心我吗......放心，领航，我还有重要的队友们呢......不管是现在的，亦或者过去，一直没有变。"},
[9002004] = {9002004,	"我已經好久沒有......這麼放鬆過了......領航，請在我身邊再待一會吧。",	"0",	"0",	"0",	"我已经好久没有......这么放松过了......领航，请在我身边再呆一会吧。"},
[9002005] = {9002005,	"嗯......我在想，如果這樣的日子能持續下去，十年，二十年......會是什麼樣呢?",	"0",	"0",	"0",	"嗯......我在想，如果这样的日子能持续下去，十年，二十年......会是什么样呢?"},
[9002006] = {9002006,	"嗚哇啊——領、領航，請不要這樣！這裡、隨時會有人進來的。",	"0",	"0",	"0",	"呜哇啊——领、领航，请不要这样！这里、随时会有人进来的。"},
[9002007] = {9002007,	"嗚——這、這也是秘書官要負責的事情嗎？不、不小心的？嗚——",	"0",	"0",	"0",	"呜——这、这也是秘书官要负责的事情吗？不、不小心的？呜——"},
[9002008] = {9002008,	"領航想要睡覺可以去沙發上靠一會哦。為什麼......盯著我的腿看。",	"0",	"0",	"0",	"领航想要睡觉可以去沙发上靠一会哦。为什么......盯着我的腿看。"},
[9002009] = {9002009,	"唔，突然湊那麼近............領航，你怎麼了？",	"0",	"0",	"0",	"唔，突然凑那么近............领航，你怎么了？"},
[9002010] = {9002010,	"領航——（吃驚）今天稍微來得比平時早一點呢。......你......剛剛什麼都沒看到吧？",	"0",	"0",	"0",	"领航——（吃惊）今天稍微来得比平时早一点呢。......你......刚刚什么都没看到吧？"},
[9002011] = {9002011,	"由我來當領航的秘書官......？我真的可以嗎？......不、我一定可以的，多洛莉絲作為領航的秘書官、會加油的！",	"0",	"0",	"0",	"由我来当领航的秘书官......？我真的可以吗？......不、我一定可以的，多洛莉丝作为领航的秘书官、会加油的！"},
[9002012] = {9002012,	"我遵守了與您的約定，領航。容我再通報一次，多洛莉絲平安歸來了。",	"0",	"0",	"0",	"我遵守了与您的约定，领航。容我再通报一次，多洛莉丝平安归来了。"},
[9002013] = {9002013,	"多洛莉絲在第三研究室的常服，這是多洛莉絲最初的工作服。即使時間荏苒，她對安潔莉卡的思念也不會中斷。這股思念不應該，也從來不會束縛住多洛莉絲的腳步。而是成為一種回憶起來略帶酸甜的憧憬，催促著多洛莉絲啟程。",	"0",	"0",	"0",	"多洛莉丝在第三研究室的常服，【嫉妒】事件结束后，艾吉斯对于多洛莉丝的去留给出了三个建议。第一个建议，假如多洛莉丝不愿意再有作为驾驶员的意志，可以退役转入艾吉斯的内务部门。第二个建议，不少小队被多洛莉丝的意志所打动，她们愿意为多洛莉丝留出一个位置。第三个建议，作为第三研究室防卫班的队长，重整防卫班，但是这会非常辛苦，而且因为【嫉妒】的前车之鉴，防卫班的新人在适格率和战斗适应性方面一定会比多洛莉丝高。………………我决定了。"},
[9002014] = {9002014,	"暫未開放",	"0",	"0",	"0",	"测试文本"},
[9003001] = {9003001,	"從這裡可以眺望到遠處的城鎮，真好啊。",	"0",	"0",	"0",	"从这里可以眺望到远处的城镇，真好啊。"},
[9003002] = {9003002,	"領航...突然這麼問或許您會覺得奇怪，但您能告訴我，您是為了什麼而戰嗎？......這樣啊，嗯，謝謝。",	"0",	"0",	"0",	"领航...突然这么问或许您会觉得奇怪，但您能告诉我，您是为了什么而战吗？......这样啊，嗯，谢谢。"},
[9003003] = {9003003,	"呼...不知不覺已經過去這麼久了......稍微有些餓了呢，待會要一起用餐嗎，領航？",	"0",	"0",	"0",	"呼...不知不觉已经过去这么久了......稍微有些饿了呢，待会要一起用餐吗，领航？"},
[9003004] = {9003004,	"誒,我臉上有什麼奇怪的東西嗎？",	"0",	"0",	"0",	"诶,我脸上有什么奇怪的东西吗？"},
[9003005] = {9003005,	"這樣子摸頭很累吧，需要我蹲下來嗎？領航？",	"0",	"0",	"0",	"这样子摸头很累吧，需要我蹲下来吗？领航？"},
[9003006] = {9003006,	"如果再繼續的話，會讓我困擾的，領航。",	"0",	"0",	"0",	"如果再继续的话，会让我困扰的，领航。"},
[9003007] = {9003007,	"保持良好的身材是戰士的必修課。其難度不比與原罪廝殺低，主要的考驗在於當喜歡的食物出現在面前時，該如何保持克制。",	"0",	"0",	"0",	"保持良好的身材是战士的必修课。其难度不比与原罪厮杀低，主要的考验在于当喜欢的食物出现在面前时，该如何保持克制。"},
[9003008] = {9003008,	"手滑了嗎？如果是領航的話，姑且...就當作是個意外了。",	"0",	"0",	"0",	"手滑了吗？如果是领航的话，姑且...就当作是个意外了。"},
[9003009] = {9003009,	"這是新的訓練科目嗎？的確，平時疏忽了對於雙腿的鍛煉，來吧，領航，無論多痛苦我都會忍受住的。",	"0",	"0",	"0",	"这是新的训练科目吗？的确，平时疏忽了对于双腿的锻炼，来吧，领航，无论多痛苦我都会忍受住的。"},
[9003010] = {9003010,	"無論是什麼樣的工作，我都會認真面對。",	"0",	"0",	"0",	"无论是什么样的工作，我都会认真面对。"},
[9003011] = {9003011,	"是有新任務派發嗎？",	"0",	"0",	"0",	"是有新任务派发吗？"},
[9003012] = {9003012,	"作為聯合部隊的領隊，我想在各方面都能幫到領航，我認為這是我應盡的責任。",	"0",	"0",	"0",	"作为联合部队的领队，我想在各方面都能帮到领航，我认为这是我应尽的责任。"},
[9003013] = {9003013,	"朱利烏斯的工作服。束正領帶，綁好發飾。換上了工作服的朱利烏斯，仿佛變得不再那麼堅毅。昏沉的下午，在稠密的紙漿交迭中，來之不易的蜜露托帶著思緒破卻了霧靄，精神因此充盈而飽滿。和煦的陽光中，能聞到乾爽芬芳的香味，塵埃透過在光的縫隙中翻滾。朱利烏斯，今天，明天，後天，一直呆在這裡，等待著為她的領航遞上一杯蜂蜜茶。",	"0",	"0",	"0",	"朱利乌斯的工作服，束正领带，绑好发饰，换上了工作服的朱利乌斯，仿佛变得不再那么坚毅。昏沉的下午，在稠密的纸浆交迭中，来之不易的蜜露托带着思绪破却了雾霭，精神因此充盈而饱满和煦的阳光中，能闻到干爽芬芳的香味，尘埃透过在光的缝隙中翻滚，朱利乌斯，今天，明天，后天，一直呆在这里，等待着为她的领航递上一杯蜂蜜茶。"},
[9003014] = {9003014,	"暫未開放",	"0",	"0",	"0",	"商城购买获得"},
}
return HomecharactertxtLocalData